import '../css/VideoPlayer.css';
import React from 'react';
import ReactPlayer from 'react-player';

const VideoPlayer = (props) => {
  return (
    <div id='video-player-wrapper'>
      <ReactPlayer
        url={props.videoLink}
        controls={true}
        width='100%'
        height='100%'
      />
    </div>
  );
};

export default VideoPlayer;
